{
    "name": "pipe-dream/laravel-create",
    "type": "package",
    "description": "Watch how this package DESTROYS all other generators. Boilerplate repos HATE it!",
    "keywords": [
        "laravel",
        "package"
    ],
    "license": "MIT",
    "require": {
        "php": "^7.1.3"
    },
    "require-dev": {

    },
    "config": {
        "optimize-autoloader": true,
        "preferred-install": "dist",
        "sort-packages": true
    },
    "extra": {
        "laravel": {
            "providers": [
                "PipeDream\\LaravelCreate\\LaravelCreateServiceProvider"
            ]
        }
    },
    "autoload": {
        "psr-4": {
            "PipeDream\\LaravelCreate\\": "src/"
        }
    },
    "autoload-dev": {
        "psr-4": {
            "Tests\\": "tests/"
        }
    },
    "minimum-stability": "dev",
    "prefer-stable": true,
    "scripts": {
        "post-autoload-dump": [
            "Illuminate\\Foundation\\ComposerScripts::postAutoloadDump",
            "@php ../../../artisan package:discover --ansi"
        ],
        "post-update-cmd": [

        ]
    }
}

const mix = require('laravel-mix');

require('laravel-mix-tailwind');
require('laravel-mix-purgecss');

/*
 |--------------------------------------------------------------------------
 | Mix Asset Management
 |--------------------------------------------------------------------------
 |
 | Mix provides a clean, fluent API for defining some Webpack build steps
 | for your Laravel application. By default, we are compiling the Sass
 | file for the application as well as bundling up all the JS files.
 |
 */

mix.js('src/resources/js/app.js', 'src/public/js')
   .postCss('src/resources/css/app.css', 'src/public/css')
   .purgeCss();

/* while developing make sure public/vendor/pipe-dream/laravel is fresh */
mix.copy('src/public/css/app.css', '../../../public/vendor/pipe-dream/laravel-create/css/app.css')
mix.copy('src/public/js/app.js', '../../../public/vendor/pipe-dream/laravel-create/js/app.js')
mix.disableSuccessNotifications();
if (mix.inProduction()) {
  mix.version();
}
